public Node reverseSinglyLinkedList(Node head) {
    //1 -> 2 -> 3
    Node current = head;// 1
    Node prev = null;
    Node next = null;

    while (current != null) {
        next = current.getNext();// next = 2, next = 3;
        current.setNext(prev); // 1-> null, 2-> 1->null
        prev = current; // prev = 1
        current = next;// current = 2
    }

    head = prev;

